import logo from '../../assets/logo.svg';
import './App.css';

import React, {useState} from 'react';

import Title from '../../elements/Title';
import CuisineList from '../CusineList';

function App() {
  const [cuisine, setCuisine] = React.useState({
    cuisine: [
      'hamburger',
      'pizza',
      'friedchicken',
      'vegetarian',
      'vegan',
      'fastfood',
      'seafood',
      'breakfast',
      'tacos',
      'asian'
    ]
  })



  return (
    <div className="App">
      <CuisineList cuisine={cuisine} />
    </div>
  );
}

export default App;
